import React from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import Accessories from "./components/Accessories";
import AccessoryScreen from "./components/AccessoryScreen";
import CartScreen from "./components/CartScreen";
import Dresses from "./components/Dresses";
import DressScreen from "./components/DressScreen";
import Footer from "./components/Footer";
import Header from "./components/Header";
import Home from "./components/Home";
import Planning from "./components/Planning";
import ProductScreen from "./components/ProductScreen";
import Shoes from "./components/Shoes";
import ShoeScreen from "./components/ShoeScreen";
import SigninScreen from "./components/SigninScreen";
// import SigninScreen from "./components/SigninScreen";

export default function Router() {
  return (
    <BrowserRouter>
      <Header />
      <Switch>
        <Route exact path="/home" component={Home} />
        <Route exact path="/product/:id" component={ProductScreen} />
        <Route exact path="/dress" component={Dresses} />
        <Route exact path="/dress/:id" component={DressScreen} />
        <Route exact path="/shoe" component={Shoes} />
        <Route exact path="/shoe/:id" component={ShoeScreen} />
        <Route exact path="/accessory" component={Accessories} />
        <Route exact path="/accessory/:id" component={AccessoryScreen} />
        <Route exact path="/plan" component={Planning} />
        <Route exact path="/signin" component={SigninScreen} />
        <Route exact path="/signin" component={SigninScreen} />
        <Route exact path="/cart/:id?" component={CartScreen} />
        {/* <Route exact path="/signin" component={SigninScreen} /> */}
        <Route exact path="/" component={Home} />
      </Switch>

      <Footer />
    </BrowserRouter>
  );
}
